css:
.header-view {
  position: fixed;
  width: 100%;
  z-index: 10;
  position: relative;
}
.header-view .heading-close {
  color: #000000;
}
.header-view .heading-title {
  padding-left: 6px;
}
.header-view .heading-status {
  padding-left: 9px;
}
.header-view .icon-alert {
  color: #cd8e00;
}
.header-view .icon-check {
  color: #45a815;
}
.header-view .icon-hourglass {
  color: #444444;
}
.header-view .icon-stop {
  color: #cc0000;
}
.script-view {
  overflow: scroll;
  max-height: 300px;
  height: auto;
  margin-bottom: 0px;
}
.script-view .panel-body pre {
  background: #f4f4f4;
  color: #444444;
}
.script-view .stderr {
  color: #cc0000;
}
.script-view .line {
  border-radius: 0px;
  margin: 0px;
  padding: 0px;
}
